import { Square } from "./Square";

export class Board{
    size = 3
    board = Array.from(Array(size), ()=> Array.from(Array(size), ()=> new Square()))
    Board(size){
        this.size = size
        this.board = Array.from(Array(size), ()=> Array.from(Array(size), ()=> new Square()))
        //Array.from(Array(2), () => new Array(4))
    }
}
